import * as React from "react";
import "./Matching.css";
import { Box } from "@mui/material";
import Navbars from "../Navbar/navbarHome2.js";
import Drawer from "../Drawer/Drawer";
import {FaLanguage, FaFile } from "react-icons/fa";

const Matching = () => {
  const [value, setValue] = React.useState(new Date());
  const [value2, setValue2] = React.useState(new Date());

  return (
    <div className="App-body-Order">
      <header className="App-header">
        <Navbars />
      </header>

      <Box sx={{ display: "flex", width: "100% " }}>
        <Drawer />

        <div style={{ marginTop: 60, height: 100 }}>
          <h4
            style={{
              fontWeight: 500,
              fontSize: 36,
              color: " #333333",
              marginLeft: 20,
              position: "absolute",
              top: "13%",
            }}
          >
            Translate
          </h4>
        </div>

        <div className="bodyNotificaion">
          <div style={{ margin: 30 }}>
            <p
              style={{
                textAlign: "start",
                color: "#034D82",
                fontWeight: 600,
                fontSize: 24,
              }}
            >
              Article
            </p>
            <div>
              <button className="buttonMatching">
                <FaLanguage className="icons" />
                <p>Text</p>
              </button>
              <button>
                <FaFile className="icons" />
                <p>File</p>
              </button>
            </div>
          </div>
        </div>
      </Box>
    </div>
  );
};

export default Matching;
